import './App.css';
import React from 'react';
import {Route} from 'react-router-dom';
import {Landing} from './components/Landing.jsx';


function App() {
  return (
    <React.Fragment>
      <Route exact path = "/" component={ Landing } />
    </React.Fragment>
  );
}

export default App;
